RUMIKO A 
Age: 28
Eyecolor: BROWN
Haircolor: BLACK
Height: 178 cm
Weight: 52 kg
Breast Size: Medium
Measurements: 85/61/87
Country: Ukraine
Ethnicity: Asian
Bio: I think I blend in wherever I am.  I can be social and have conversation with anyone and I love meeting many people.  I often travel even if I can only be gone a few days, it feels good to break free from everyday life.   

-------------------------------------

BAYLE A 
Age: 22
Eyecolor: BLUE
Haircolor: BLOND
Height: 173 cm
Weight: 50 kg
Breast Size: Small
Measurements: 83/60/88
Country: Russian Federation
Ethnicity: Caucasian
Bio: I like to be photographed and because of this, I chose to work as a model professionally. I like constantly transforming and showing myself different ways. When I have time off I like to drink cup a tea and watch the fire. I love to go to museums and see paintings and sculptures of famous masters of the past.

